import React from "react";

const Footer = () => (
    <footer>
        Created by <span id="ravi">Ravi</span>
        <br />
        <span>
            <i
                className="fab fa-github"
                onClick={() =>
                    window.open("https://github.com/git-077-Rvraj", "_blank")
                }
            ></i>{" "}
            <i
                className="fab fa-hackerrank"
                onClick={() =>
                    window.open("https://www.hackerrank.com/Rajat_M", "_blank")
                }
            ></i>{" "}
            <i
                className="fab fa-linkedin"
                onClick={() =>
                    window.open(
                        "https://www.linkedin.com/in/ravi-raj-765bba1b7/",
                        "_blank"
                    )
                }
            ></i>{" "}

            <i
                className="fab fa-twitter"
                onClick={() =>
                    window.open("https://twitter.com/Rajat__m", "_blank")
                }
            ></i>
        </span>
    </footer>
);

export default Footer;
